import React from 'react';
import './AboutUs.css';

function AboutUs() {
  return (
    <div className="aboutus-container">
      <div className="aboutus-overlay">
        <h2>Naurio Ecommerce Private Limited</h2>
        <p>
          <strong>Email:</strong> naurioprivatecompanyltd.01.org@gmail.com
        </p>
        <p>
          <strong>Location:</strong> Kathmandu, Nepal
        </p>
      </div>
    </div>
  );
}

export default AboutUs;
